--
-- Table of auction prices scraped (and averaged from) an actual 3.3.5 server with a population of over 5k players.
--


DROP TABLE IF EXISTS `mod_auctionhousebot_auction_prices`;
CREATE TABLE `mod_auctionhousebot_auction_prices` (
	`entry` MEDIUMINT(9) NOT NULL,
	`price` INT(11) NOT NULL,
	PRIMARY KEY (`entry`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

